import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import logo from '../images/img-2.png';
import './Navbar.css';
import Login from './Login';
import StudentForm from './StudentForm';
import { makeStyles } from '@material-ui/core/styles';
import { Button } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({
  titre: {
    textAlign:"center"
  }
}
  ));
function Navbar() {

  const [openPopup,setOpenPopup] =useState(false);
  const [click, setClick] = useState(false);
  const classes = useStyles();
  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  return (
    <>
      <nav className="navbar bg-transparentv">


        <Link to='/' className='navbar-logo' onClick={closeMobileMenu}>
          <img alt="logo" className="logo" src={logo}></img>
        </Link>

        <div className='menu-icon' onClick={handleClick}>
          <i className={click ? 'fas fa-times' : 'fas fa-bars'} />
        </div>
          <ul className={click ? 'nav-menu active' : 'nav-menu'}>

            <li className='nav-item'>
              <Link to='/' className='nav-links' onClick={closeMobileMenu}>
                Home
              </Link>
            </li>
            <li
              className='nav-item'

            >
              <Link
                to='/about'
                className='nav-links'
                onClick={closeMobileMenu}
              >
                About
              </Link>

            </li>
            <li className='nav-item'>
              <Link
                to='/cours'
                className='nav-links'
                onClick={closeMobileMenu}
              >
                Cours
              </Link>
            </li>
            <li className='nav-item'>
              <Link
                to='/contact'
                className='nav-links'
                onClick={closeMobileMenu}
              >
                Contact 
              </Link>
            </li>
            <li className='nav-item'>
            <button className='nav-links' onClick={() => { setOpenPopup(true);}}  >Sign-up</button>  

            </li>
          </ul>


      </nav>
      <Login title="S'inscrire dÃ¨s maintenant" className={classes.titre} openPopup={openPopup} setOpenPopup={setOpenPopup}>
        <StudentForm/>
      </Login>
    </>
  );
}

export default Navbar;
